import React from "react";
import { useParams } from "react-router-dom";

const BlogDetail = () => {
  const { id } = useParams();
  const blog = {
    1: { title: "First Blog", content: "This is the content of the first blog." },
    2: { title: "Second Blog", content: "This is the content of the second blog." },
  };

  return (
    <div>
      <h2>{blog[id]?.title}</h2>
      <p>{blog[id]?.content}</p>
    </div>
  );
};

export default BlogDetail;
